    ON UPDATE NO ACTION,
  CONSTRAINT `fk_VEHICULO_LINEA_MODELO1`
    FOREIGN KEY (`IdLinea_Modelo`)
    REFERENCES `importaciones_db`.`LINEA_MODELO` (`IdLinea_Modelo`)
    ON DELETE NO ACTION
